import React, { Component } from "react";

class Home extends Component{
    render(){
        const subtitle = "Web Designer | Web Developer"

        return(
        <div className="full-page">
            <h1 className="centered-name">
                Joseph Banwart
            </h1><br></br>
            <h2>
                {subtitle}
            </h2>
        </div>
        )
    }
}

export default Home
